INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(14, 'Gudeg', 1, 'Gudeg, adalah makanan yang menjadi ikon utama Daerah Istimewa Yogyakarta adalah gudeg. Nama\"gudeg\"didapat dari istilah bahasa Jawa hangudek. Istilah hangudek memiliki arti \'proses mengaduk\'.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(18, 'Candi Prambanan', 2, 'Prambanan adalah candi Hindu terbesar dan termegah di Indonesia. Candi ini terletak di Kecamatan Prambanan, Kabupaten Sleman, Daerah Istimewa Yogyakarta. Candi ini dibangun pada abad ke-9 Masehi oleh Rakai Pikatan, raja dari Wangsa Sanjaya.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(19, 'Sendratari Ramayana', 3, 'Sendratari Ramayana, sebuah seni tari dan drama yang digabungkan menjadi satu pertuntjukan yang apik tanpa dialog dengan cerita Ramayana. ', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(20, 'Malioboro', 2, 'Malioboro merupakan nama salah satu jalan di pusat Kota Yogyakarta. Jalan Malioboro itu sendiri merupakan salah satu jalan dari tiga jalan di Kota Yogyakarta yang membentang dari Tugu Yogyakarta hingga ke perempatan Kantor Pos Yogyakarta.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(21, 'Pantai Parangtritis', 2, 'Pantai Parangtritis adalah tempat wisata yang terletak di Kalurahan Parangtritis, KapanÃ©won Kretek, Kabupaten Bantul, Daerah Istimewa Yogyakarta. Jaraknya kurang lebih 27 km dari pusat kota. Pantai ini menjadi salah satu destinasi wisata terkenal di Yogyakarta', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(22, 'Museum Benteng Vredeburg', 2, 'Benteng Vredeburg adalah sebuah bangunan kuil yang terletak di depan Gedung Agung dan Kraton Kesultanan Yogyakarta. Sekarang, benteng ini menjadi sebuah museum. Di sejumlah bangunan di dalam benteng ini terdapat diorama mengenai sejarah Indonesia.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(23, 'Taman Pintar Yogyakarta', 2, 'Taman Pintar Yogyakarta adalah wahana wisata yang terdapat di pusat Kota Yogyakarta, tepatnya di Jalan Panembahan Senopati No. 1-3, Yogyakarta, di kawasan Benteng Vredeburg. Taman ini memadukan tempat wisata rekreasi maupun edukasi dalam satu lokasi.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(24, 'Bakpia Pathok', 1, 'Bakpia pathok adalah kue tradisional khas Yogyakarta yang terbuat dari tepung terigu, gula, telur, dan kacang hijau. Kue ini memiliki bentuk bulat pipih dengan isian kacang hijau yang dimasak dengan gula merah.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(25, 'Kopi Klotok', 1, 'Kopi klotok adalah salah satu minuman khas Yogyakarta yang terbuat dari biji kopi robusta yang disangrai dengan tingkat kematangan sedang. Kopi ini kemudian direbus dengan air panas dan diberi gula aren.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(26, 'Wedang Ronde', 1, 'Ronde adalah makanan tradisional Tionghoa dengan nama asli TÄngyuÃ¡n. Nama tangyuan merupakan metafora dari reuni keluarga. Ronde terbuat dari tepung ketan yang dicampur sedikit air dan dibentuk menjadi bola, direbus, dan disajikan dengan kuah manis. ', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(27, 'Yangko', 1, 'Yangko Yogyakarta adalah makanan khas Yogyakarta yang terbuat dari tepung ketan, gula, dan santan. Kue ini memiliki tekstur yang kenyal dan lembut, serta rasa yang manis dan gurih. Yangko biasanya disajikan dalam bentuk kotak kecil dengan isian kacang hijau.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(28, 'Wedang Uwuh', 1, 'Wedang uwuh adalah minuman tradisional khas Yogyakarta yang terbuat dari berbagai macam rempah-rempah, seperti jahe, kayu secang, serai, dan cengkeh. Minuman ini memiliki rasa manis dan pedas khas rempah serta aroma harum yang menenangkan.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(29, 'Batik', 3, 'Batik adalah kain Indonesia bergambar yang pembuatannya secara khusus dengan menuliskan atau menerakan malam pada kain itu, kemudian pengolahannya diproses dengan cara tertentu yang memiliki kekhasan.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(30, 'Sekaten', 3, 'Sekaten adalah upacara tradisional yang diadakan setahun sekali di Yogyakarta dan Surakarta. Upacara ini merupakan perayaan hari kelahiran Nabi Muhammad SAW. Sekaten berasal dari kata \"sekaten\" yang berarti \"tujuh hari\".', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(31, 'Seni Tari', 3, 'Seni tari adalah salah satu cabang seni yang mengungkapkan keindahan, ekspresi, hingga makna tertentu melalui media gerak tubuh yang disusun secara ritmis dan harmonis. Seni tari dapat dinikmati secara visual maupun audio.', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(32, 'Karawitan', 3, 'Karawitan adalah seni gamelan dan seni suara yang bertangga nada slendro dan pelog. Kesenian ini terkenal di Pulau Jawa dan Bali. Istilah karawitan berasal dari bahasa Jawa yaitu kata \"rawit\" yang berarti halus dan lembut. Jadi karawitan berarti kelembutan', 'data:image/jpeg;base64,');
INSERT INTO `objek_wisata` (`id`, `nama`, `id_jenis`, `deskripsi`, `foto`) VALUES
(33, 'Upacara Labuhan', 3, 'Upacara Labuhan adalah upacara adat yang dilakukan oleh Raja-raja di Keraton Yogyakarta. Upacara ini bertujuan untuk memohonkan keselamatan dan kesejahteraan bagi masyarakat, serta memohon kemakmuran bagi kerajaan.', 'data:image/jpeg;base64,');

